import React from 'react';

function App() {
  return (
    <div>
      <Card title="Card 1" content="Conteúdo do card 1" />
      <Card title="Card 2" content="Conteúdo do card 2" />
    </div>
  );
}

function Card(props) {
  return (
    <div className="card" style={{ backgroundColor: '#f5f5f5' }}>
      <h3>{props.title}</h3>
      <p>{props.content}</p>
    </div>
  );
}

export default App;
